let clockwise=true // Acts as a switch (if true: go anticlockwise, if false: go clockwise)

setInterval(()=>{ // Starts intervals
    if(clockwise){
    feature.rotation.y = feature.rotation.y + 20 // move anticlockwise
    clockwise = !clockwise
  }else{
    feature.rotation.y = feature.rotation.y - 20 // move clockwise
    clockwise = !clockwise
  }
},5000)

setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)

let o = parcel.getFeatureById('nought')
let x = parcel.getFeatureById('cross')

let clones = []
let nought = true

feature.on('click', e => {
  if (clones.length === 9) {
    clones.forEach(c => c.remove())
    clones = []
  }

  let c = (nought ? o : x).clone()
  c.position.copyFrom(e.point)
  clones.push(c)

  nought = !nought
})

