let ball, paddle, frame, blocks

feature.on('keys', e => {
  if (e.keys.left) {
    paddle.moveLeft()
  } else if (e.keys.right) {
    paddle.moveRight()
  }
})

feature.on('start', e => {
  reset()
})

feature.on('frame', e => {
  frame += 1
  update()
  draw()
})

function update() {
  ball.update()
}

function draw() {
  feature.screen.fill(0)

  ball.draw()
  paddle.draw()
  for (j = 0; j < blocks.length; j ++) {
    blocks[j].draw()
  }
}

function reset() {
  ball = new Ball(Math.round(Math.random() * 64), 32)
  paddle = new Paddle(29, 60, 6)
  frame = 0
  blocks = []
  for (y = 0; y < 5; y ++) {
    for (z = 0; z < 8; z ++) {
      blocks.push(new Block(Math.floor(feature.screenWidth / 8 * z + 2), y * 4 + 2, 5, 3))
    }
  }
  draw()
}

// classes

class Ball {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y

    this.xVel = Math.random() > 0.5 ? 1 : -1
    this.yVel = 1
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    // wall collision detection

    if (this.xPos + this.xVel > 63 || this.xPos + this.xVel < 0) {
      this.xVel *= -1
    }
    if (this.yPos + this.yVel < 0) {
      this.yVel *= -1
    }
    if (this.yPos + this.yVel > 63) {
      reset()
    }

    // paddle collision detection

    if ((this.yPos + this.yVel == paddle.yPos)) {
      let nextX = this.xPos + this.xVel
      if (nextX >= paddle.xPos && nextX <= paddle.xPos + paddle.width) {
        this.yVel *= -1
      }
    }

    // block collision detection

    for (let i = 0; i < blocks.length; i ++) {
      let block = blocks[i]
      let nextX = this.xPos + this.xVel
      let nextY = this.yPos + this.yVel

      if (nextX >= block.x && nextX < block.x + block.width && nextY >= block.y && nextY < block.y + block.height) {
        if (this.xPos < block.x || this.xPos > block.x + block.width - 1) {
          this.xVel *= -1
        }
        if (this.yPos < block.y || this.yPos > block.y + block.height - 1) {
          this.yVel *= -1
        }

        blocks.splice(i, 1)
        break
      }
    }

    // update position

    this.xPos += this.xVel
    this.yPos += this.yVel
  }

  draw() {
    for (let i = 0; i < 3; i ++) {
      feature.screen[this.yPos * feature.screenWidth * 3 + this.xPos * 3 + i] = 255
    }
  }
}

class Paddle {
  constructor(x, y, w) {
    this.xPos = x
    this.yPos = y
    this.width = w
  }

  draw() {
    for (let i = this.yPos * feature.screenWidth * 3 + this.xPos * 3; i < this.yPos * feature.screenWidth * 3 + (this.xPos + this.width) * 3 + 3; i ++) {
      feature.screen[i] = 255
    }
  }

  moveLeft() {
    if (this.xPos > 0) {
      this.xPos -= 2
      draw()
    }
  }

  moveRight() {
    if (this.xPos + this.width < 63) {
      this.xPos += 2
      draw()
    }
  }
}

class Block {
  constructor(x, y, w, h) {
    this.x = x
    this.y = y
    this.width = w
    this.height = h
  }

  draw() {
    // horizontal lines
    for (let i = 0; i < this.width; i++) {
      feature.screen[this.y * feature.screenWidth * 3 + (this.x + i) * 3] = 255
      feature.screen[(this.y + this.height - 1) * feature.screenWidth * 3 + (this.x + i) * 3] = 255
    }

    // vertical lines
    for (let i = 0; i < this.height; i++) {
      feature.screen[(this.y + i) * feature.screenWidth * 3 + this.x * 3] = 255
      feature.screen[(this.y + i) * feature.screenWidth * 3 + (this.x + this.width - 1) * 3] = 255
    }
  }
}

let player, frame, bullets, mushrooms

// main loop functions

feature.on('keys', e => {
  if (!player) { return }

  if (e.keys.left) {
    player.xVel = -1
  } else if (e.keys.right) {
    player.xVel = 1
  } else {
    player.xVel = 0
  }

  if (e.keys.up) { 
    player.yVel = -1
  } else if (e.keys.down) {
    player.yVel = 1
  } else {
    player.yVel = 0
  }

  if (e.keys.a) {
    if (bullets.length == 0 || frame - bullets[bullets.length - 1].timeBorn > 3) {
      player.shoot()
    }
  }
})

feature.on('start', e => {
  reset()
})

feature.on('frame', e => {
  frame += 1
  update()
  draw()
})

function update() {
  player.update()

  let inactiveBullets = []
  for (let i = 0; i < bullets.length; i ++) {
    bullets[i].update()
    if (!bullets[i].active) {
      inactiveBullets.push(i)
    }
  }
  for (let i = 0; i < inactiveBullets.length; i ++) {
    bullets.splice(inactiveBullets[i] - i, 1)
  }

  let deadMushrooms = []
  for (let i = 0; i < mushrooms.length; i ++) {
    if (mushrooms[i].health <= 0) {
      deadMushrooms.push(i)
    }
  }
  for (let i = 0; i < deadMushrooms.length; i ++) {
    mushrooms.splice(deadMushrooms[i] - i, 1)
  }
}


function draw() {
  feature.screen.fill(0)
  player.draw()
  for (let i = 0; i < bullets.length; i ++) {
    bullets[i].draw()
  }

  for (let i = 0; i < mushrooms.length; i ++) {
    mushrooms[i].draw()
  }
}

function reset() {
  frame = 0
  player = new Player(30, 58)
  bullets = []

  mushrooms = []
  for (let i = 0; i < Math.round(Math.random() * 20) + 5; i ++) {
    mushrooms.push(new Mushroom(2 * Math.round(Math.random() * 31), 2 * Math.round(Math.random() * 26)))
  }

  draw()
}

// helper functions

function drawPixel(x, y, rgb) {
  if (rgb.length != 3) { return }

  for (let z = 0; z < rgb.length; z ++) {
    feature.screen[y * feature.screenWidth * 3 + x * 3 + z] = rgb[z]
  }
}

function drawBlock(x, y, rgb, size) {
  for (let u = 0; u < size; u ++) {
    for (let r = 0; r < size; r ++) {
      drawPixel(x + u, y + r, rgb)
    }
  }
}

// classes

class Player {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y
    this.xVel = 0
    this.yVel = 0
    this.size = 4
  }

  shoot() {
    bullets.push(new Bullet(this.xPos + 1, this.yPos - 1))
  }

  update() {
    if (frame % 2 != 0) {
      return
    }

    let nextX = this.xPos + this.xVel
    let nextY = this.yPos + this.yVel

    // wall collision detection

    if (nextX >= 0 && nextX <= 63 - this.size + 1) {
      this.xPos += this.xVel
    }
    if (nextY >= 0 && nextY <= 63 - this.size + 1) {
      this.yPos += this.yVel
    }
  }

  draw() {
    drawBlock(this.xPos, this.yPos, [150, 255, 140], this.size)
  }
}

class Bullet { 
  constructor(x, y) {
    this.xPos = x
    this.yPos = y
    this.size = 2
    this.yVel = -2
    this.timeBorn = frame
    this.active = true
  }

  update() { 
    this.yPos += this.yVel

    if (this.yPos < 0 - this.size) {
      this.active = false
    }

    // detect collision with mushroom

    if (mushrooms) {
      for (let i = 0; i < mushrooms.length; i ++) {
        let nextY = this.yPos + this.yVel
        let mushroom = mushrooms[i]
        if (nextY >= mushroom.yPos && nextY < mushroom.yPos + mushroom.size - 1 
           && this.xPos >= mushroom.xPos - 1 && this.xPos < mushroom.xPos + mushroom.size) {
          this.active = false
          mushroom.health -= 1
        }
      }
    }
  }

  draw() {
    drawBlock(this.xPos, this.yPos, [255, 255, 255], this.size)
  }
}

class Mushroom {
  constructor(x, y) {
    this.xPos = x
    this.yPos = y
    this.size = 4
    this.colour = [240, 240, 10]
    this.health = 3
  }

  draw() {
    if (this.health == 3) {
      drawBlock(this.xPos, this.yPos, this.colour, this.size)
    } else if (this.health == 2) {
      for (let i = 0; i < this.size; i ++) {
        drawPixel(this.xPos + i, this.yPos, this.colour)
        drawPixel(this.xPos + i, this.yPos + this.size - 1, this.colour)
        if (i >= 1 && i < this.size - 1) {
          drawPixel(this.xPos, this.yPos + i, this.colour)
          drawPixel(this.xPos + this.size - 1, this.yPos + i, this.colour)
        }
      }
    } else if (this.health == 1) {
      for (let i = 1; i < this.size - 1; i ++) {
        drawPixel(this.xPos + i, this.yPos, this.colour)
        drawPixel(this.xPos + i, this.yPos + this.size - 1, this.colour)
        drawPixel(this.xPos, this.yPos + i, this.colour)
        drawPixel(this.xPos + this.size - 1, this.yPos + i, this.colour)
      }
    }
  }
}

// JumpIt! by Frank Force
// A = Jump / B = Restart

let distance, playing, ground, Y, V, W;

const reset = ()=>
{
    Y = 0;
    W = 22;
    distance = V = 0;
    playing = 1;
}

feature.on('start', e=> 
{
    reset();
});

feature.on('frame', e=> 
{
    clearScreen();
    playing && ++distance;

    // draw ground
    for (let i=5; i--;)
    {
        const j = i+distance/W|0;
        setDrawColorHSLA(j/29);
        const g = 47-Math.cos(j*j)*15|0;
        drawRectOutline(j*W-distance-7, g, W-3, 1e4);
        i && (ground=g);
    }

    // sub step physics
    for (let i=2; i--;)
    {
        Y -= V -= .06;
        if (Y > ground)
        {
            // check for safe landing
            V = 0;
            Y < ground+3 ? Y = ground : playing = 0;
        }
    }

    // draw player
    setDrawColorHSLA(distance/50, 1, .7);
    drawRect(9, Y-9, 6, 9);

    // draw score
    setDrawColorHSLA(0, 0, 1);
    drawNumber(distance/W|0, 24, 0);
});

feature.on('keys', e=>
{
    // jump
    if (e.keys.a)
        Y-ground || (V=2);
    if (e.keys.b)
        reset();
});

